import React from "react";

function  about(){
    return(
        <Container>
            <h1 style={{width:"100%", textAlign:"center"}}>About Me</h1>
            <Row>
                <Col sm={6} md={5} lg={{span:"4"}}></Col>
            </Row>
        </Container>
    );
}

export default About;
